import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Qualifications = () => {
  return (
    <div className="container mt-5 text-white text-center">
      <h2 className="mb-4 fw-bold text-white title-fade-in">
        My Qualifications and Experiences
      </h2>
      <div className="row justify-content-center">
        {qualificationsData.map((item, index) => (
          <div className="col-md-8 mb-4" key={index}>
            <div className="card bg-dark text-white shadow-lg border border-primary">
              <div className="card-body">
                <h4 className="card-title text-info">{item.title}</h4>
                {item.subtitle && <p className="text-secondary">{item.subtitle}</p>}
                {item.details && (
                  <ul className="list-unstyled">
                    {item.details.map((detail, idx) => (
                      <li key={idx}>● {detail}</li>
                    ))}
                  </ul>
                )}
                <a
                  href={item.link}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-warning text-decoration-none"
                >
                  {item.linkText}
                </a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

const qualificationsData = [
  {
    title: "Software Engineering Student - 3rd Year",
    subtitle: "Altinbas University, Türkiye, Istanbul",
    link: "https://altinbas.edu.tr/",
    linkText: "University Website",
  },
  {
    title: "AI Prompt Engineer / AI Trainer",
    subtitle: "Outlier Company",
    details: [
      "Prompt Creation: Designing prompts to generate optimal AI responses.",
      "Response Evaluation: Assessing AI responses for quality and accuracy."
    ],
    link: "https://outlier.ai/",
    linkText: "Company Link",
  },
  {
    title: "English Teacher",
    subtitle: "Part-time English Teacher at English Time School, Istanbul.",
    link: "https://www.englishtime.com/en",
    linkText: "English Time Website",
  }
];

export default Qualifications;
